import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import {Board} from './components/board.js'


export class Game extends React.Component {
  render() {
      return(
        <div className="game">
          <div className="game-board">
            <Board />  
          </div>  
        </div>
      )
  }
}
